import { HashRouter, Routes, Route } from "react-router-dom";
import ProjectHeader from "./header";
import Dashboard from "./Dashboard";
import NewCustomer from "./newcustomer";
import AllCustomer from "./allcustomer";
import Details from "./details";
import Addproduct from "./addproduct";

function App() {
  return (
    <HashRouter>
      <ProjectHeader />
      <Routes>
        <Route exact path="/" element={<Dashboard />}></Route>
        <Route exact path="/addcustomer" element={<NewCustomer />}></Route>
        <Route exact path="/allcustomer" element={<AllCustomer />}></Route>
        <Route exact path="/details/:customerid" element={<Details />}></Route>
        <Route exact path="/addproduct" element={<Addproduct />}> </Route>
        <Route exact path="/productlist" element={<Productlist />}> </Route>
      </Routes>
    </HashRouter>
  );
}

export default App;
